import React from "react";
const Slotm = () => {
  let x = "A";
  let y = "A";
  let z = "u";
  if (x === y && y === z) {
    return (
      <>
        this is matching
        <h1>
          {x}
          {y}
          {z}
        </h1>
      </>
    );
  } else {
    return (
      <>
        this is not matching
        <h1>
          {x}
          {y}
          {z}
        </h1>
      </>
    );
  }
};

function App() {
  return (
    <>
      <h1 style={{ textAlign: "center" }}>slot machine</h1>
      <Slotm />
    </>
  );
}

export default App;
